import './PokeCard.css';

function PokeCard() {
  const elementTypes = 'eletric';
  const name = 'pikachu';
  const id = '27';

  return (
    <li className='card {}'>
        <img class="card-image "alt ="${name}" src="https://raw.githubusercontent.com/PokeAPI/sprites/master/sprites/pokemon/1.png" />
        <h2 class="card-title"> {id}. {name}</h2>
        <p class="card-subtitle">' Plant|Poisonous '</p>
    </li>
  );
}

export default PokeCard;
